import React from 'react';
import './App.css';
import Header from './components/Header';
import Navbar from "./components/Navbar";

const App = () => {
  return (
    <div className='app-wrapper'>
      <Header />
      <Navbar />
      <div className='content'>
        <div><img src='https://d.wattpad.com/story_parts/670629122/images/157362a7bdd09c5e965962849868.jpg'/></div>
        <div><img width='200px' height='200px' src='https://pbs.twimg.com/profile_images/1122995987730112513/sPturtT9_400x400.jpg'/>
          description
        </div>
        <div>
          My posts
          <div>
            New post
          </div>
          <div>
            <div>
              Post 1
            </div>
            <div>
              Post 2
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
